import React from 'react';
import { Link } from 'react-router-dom';

const ElementsPage = () => {
    return(
            <div className="all_elements--button button-margin_top" id='ordinary--button'>
                  <Link to="./pages/elements_page/ElementsPage">
                    <button>
                      Browse all elements
                    </button>
                  </Link>
            </div>
    )
}   

export default ElementsPage;
